(1, 1, 'A Complete guide to modern social media Engineering', 'Annotation2019-09-11194452.889a46.png', 'WhatsAppImage2020-02-18at17.12.57.deacc5.jpeg', '<strong class=\"ql-size-large\"><em>Even if you\'re not sure what a blog is, you\'ve no doubt come across one at some point in time. Perhaps you\'ve stumbled across a blog when you\'ve searched \"healthy dinner recipes\".</em></strong></p><p><br></p><p>Alternatively, maybe you used a blog to get more information on&nbsp;<a href=\"https://blog.hubspot.com/marketing/seo-strategy\" target=\"_blank\" style=\"color: rgb(0, 145, 174);\">SEO strategies</a>.</p><p><span style=\"color: rgb(136, 136, 136);\">In fact, if you\'re reading this, guess what?&nbsp;</span><em style=\"color: rgb(136, 136, 136);\">You\'re on a blog.&nbsp;</em><span style=\"color: rgb(136, 136, 136);\">(Very meta, I know.)</span></p><p><span class=\"ql-size-large\">If your business doesn\'t have a blog, you might want to reconsider â€” </span><sup class=\"ql-size-large\"><s><u>B2B </u></s></sup><span class=\"ql-size-large\">marketers who use blogs&nbsp;</span><a href=\"https://blog.hubspot.com/marketing/business-blogging-in-2015\" target=\"_blank\" style=\"color: rgb(0, 145, 174);\" class=\"ql-size-large\">receive 67% more leads</a><span class=\"ql-size-large\">&nbsp;than those who do not, and blogs have been rated the&nbsp;</span><a href=\"https://blog.hubspot.com/marketing/business-blogging-in-2015\" target=\"_blank\" style=\"color: rgb(0, 145, 174);\" class=\"ql-size-large\">5th most trusted source</a><span class=\"ql-size-large\">&nbsp;for accurate online information.</span></p><p>At its most basic, blogs can help you develop an online presence, prove yourself an expert in an industry, and attract more quality leads to&nbsp;<em>all</em>&nbsp;pages of your site.</p><p>If you\'re contemplating creating a blog for your business, or simply want to know what one is, keep reading.', 'something of an excerpt', 1651407431, 14, 2, NULL, 0),
(2, 1, 'This is the tite', 'WhatsAppImage2020-02-18at17.12.57.9b48fa.jpeg', 'Annotation2019-09-11194452.4e5ab3.png', 'A Complete guide to modern social media Engineering</p><p><br></p><p><br></p><p><br></p><p><br></p><p>The more you know about your competitorsâ€™ SEO strategy, the better your own site can perform.', 'this is the excerpt', 1651417898, 23, 2, NULL, 0);
